import LoginPage from './Screens/loginPage';
import LandingPage from './Screens/landingPage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
        <Switch>
          <Route path='/'>
            <LandingPage/>
            </Route>
        </Switch>
    </Router>
  );
}

export default App;
